%[text] %[text:anchor:T_995200C7] # **CircularNetFlow Chart Examples**
%[text] **Overview**
%[text] The `CircularNetFlowChart` creates a circular chart representing the net flow between pairs of categories. There are finitely many categories arranged around the circle. The outer ring of the chart contains circular arcs with size representing the net flow from each category. The inner component of the chart contains nodes with size representing the net flow received by each category. The chart data comprises a table `LinkData`, with the following specifications.
%[text] - The table contents `A = LinkData{:, :}` is a square, nonnegative numeric 2-D matrix in which `A(i, j)` contains the (gross) flow from category `i` to category `j`. The number of rows and columns of `A` is equal to the number of categories. The diagonal elements of `A` are all zero, indicating that there is no self-flow from a category to itself.
%[text] - The variable names of the table are the names of the categories. \
%[text] The chart computes the net flow between each pair of categories from the table `LinkData`, before using the net flow data to update the graphics.
%[text] ![CircularNetFlowChart.png](text:image:31f4)
%[text] **Documentation**
%[text] - [`patch`](<matlab: doc("patch")>): Plot one or more filled polygonal regions \
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] %[text:anchor:H_E562249F] ## Create sample chart data.
%[text] Each row of the matrix represents a source ("from") category, and each column represents a sink ("to") category. The matrix element `(i, j)` contains the (gross) flow from category `i` to category `j`. The diagonal elements of the matrix are zero, indicating no self-flow.
n = 6;
linkdata = magic( n );
linkdata(1:n+1:end) = 0;
%[text] Create a list of text labels, representing the names of the categories.
labels = ["A", "B", "C", "D", "E", "F"];
%[text] Tabulate the link data.
linkdata = array2table( linkdata, "VariableNames", labels );
%%
%[text] %[text:anchor:H_ADD43B1F] ## Create a figure for the chart.
f = exampleFigure( "Name", "CircularNetFlowChart Example" ); %[output:7d289099]
%%
%[text] %[text:anchor:H_BCF91711] ## Create the chart, specifying the parent and input data.
CNFC = CircularNetFlowChart( "Parent", f, ... %[output:group:2723a45b] %[output:7d289099]
    "LinkData", linkdata ); %[output:group:2723a45b] %[output:7d289099]
%%
%[text] %[text:anchor:H_AD1F4675] ## Adjust the chart title.
title( CNFC, "CircularNetFlow Chart", "Position", [50, 120, 0] ) %[output:42cfe0cc]
%%
%[text] %[text:anchor:H_C115133C] ## Display the net flow and net sent/received amounts.
disp( CNFC.NetFlow ) %[output:4dc7bb09]
disp( "Net amounts sent:" ) %[output:68742074]
disp( CNFC.NetSent ) %[output:46ae111f]
disp( "Net amounts received: " ) %[output:21e8fed2]
disp( CNFC.NetReceived ) %[output:29201cc9]
%%
%[text] %[text:anchor:H_AE6F1C7C] ## Adjust the transparency of the chart.
CNFC.FaceAlpha = 0.25; %[output:7f8430b1]
%%
